import React, { Component } from 'react'

export default class ContributionList extends Component {
    state={
        contributions: undefined,
    }

    getCenters = async () => {
        const response = await axios.get('http://localhost:3000/api/centers')        
        this.setState({
            contributions: response.data.places
        })
    }

    render() {
        return (
            <div>
                <p>Aqui va la lista de contribuciones</p>
            </div>
        )
    }
}
